import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import ListEmployeeComponent from "./components/ListEmployeeComponent";
import HeaderComponent from "./components/HeaderComponent";
import FooterComponent from "./components/FooterComponent";
import {Container} from "react-bootstrap";
import CreateEmployeeComponent from "./components/CreateEmployeeComponent";
import ViewEmployeeComponent from "./components/ViewEmployeeComponent";
import {deleteEmployee, fetchPosts, GetUser} from "./redux/actions";
import {connect} from "react-redux";

function App() {
    this.props

    return (
        <>



            <Router>
                <a href={"https://accounts.google.com/o/oauth2/v2/auth/oauthchooseaccount?client_id=177528665108-iaph4o8tgb6lm7h6vg44m2pvicuhhv7d.apps.googleusercontent.com&redirect_uri=http%3A%2F%2Flocalhost%3A8081%2Flogin&response_type=code&scope=openid%20email%20profile&state=4SKJR2&flowName=GeneralOAuthFlow"} target="_blank">
                    Login
                </a>

                <Container className={"mt-3"}>
                    <Switch>
                        <Route path="/" exact component={ListEmployeeComponent}/>
                        <Route path="/employees" component={ListEmployeeComponent}/>
                        <Route path="/add-employee/:id" component={CreateEmployeeComponent}/>
                        <Route path="/view-employee/:id" component={ViewEmployeeComponent}/>
                    </Switch>
                </Container>


            </Router>
        </>
    );
}
const mapDispatchToProps = {
    GetUser
}

const mapStateToProps = sate => ({
    employees: sate.user.employees
})

export default connect(mapStateToProps, mapDispatchToProps)(App);
